The complement of A, denoted by A', is the set of all elements in the universal set U that are not in A. To find A', we can subtract the elements of A from U:

A' = U - A = {6, 7, 8, 9, 10}

Now, let's verify if A' is unique. The complement of A is unique because it is directly related to the specific set A and the universal set U. Since A and U are fixed in this problem, there can only be one unique complement of A, which is A' = {6, 7, 8, 9, 10}.
